import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';

const NavigationBarLogged = () => {
return(
  <>
<nav class="navbar navbar-expand-sm bg-dark navbar-dark">
  <a class="navbar-brand" href="/">
  <img src = {require('./triviacrevice2.png')} class = "image-responsive" alt ="logo" />
  Trivia Crevice
  </a>

  <ul class="navbar-nav ml-auto">
    <li class="nav-item">
      <a class="nav-link" href="/">Leader Board</a>
    </li>

    <li class="nav-item">
      <a class="nav-link" href="/logged">My Account</a>
    </li>

    <li class="nav-item">
      <a class="nav-link" href="/">Logout</a>
    </li>
  </ul>

</nav>
</>
);
};

export default NavigationBarLogged;
